import {Header, Panel} from '@enact/sandstone/Panels';
import Input from '@enact/sandstone/Input';
import Button from '@enact/sandstone/Button';
import BodyText from '@enact/sandstone/BodyText';
import css from './Login.module.less';

const Login = (props) => {
	return (
		<Panel {...props}>
			<Header title="Login" />
			<BodyText>Please enter your credentials to log in.</BodyText>
			<Input placeholder="Email" className={css.inputField} />
			<Input placeholder="Password" type="password" className={css.inputField} />
			<Button size="small" className={css.buttonCell}>
				Login
			</Button>
		</Panel>
	);
};

export default Login;
